package fes.aragon.modelo;

public class Barcos{
	private int noSerieBarco;
	private String cuota;
	private String nomBarco;
	private int noAgarre;
	
	
	public Barcos() {
		// TODO Auto-generated constructor stub
	}

	public int getNoSerieBarco() {
		return noSerieBarco;
	}

	public void setNoSerieBarco(int noSerieBarco) {
		this.noSerieBarco = noSerieBarco;
	}

	public String getCuota() {
		return cuota;
	}

	public void setCuota(String cuota) {
		this.cuota = cuota;
	}

	public String getNomBarco() {
		return nomBarco;
	}

	public void setNomBarco(String nomBarco) {
		this.nomBarco = nomBarco;
	}

	public int getNoAgarre() {
		return noAgarre;
	}

	public void setNoAgarre(int noAgarre) {
		this.noAgarre = noAgarre;
	}

}